import React, {Component} from 'react';
import {Card} from "react-bootstrap";

class Product extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Card className="my-3 p-3 rounded">
                {this.props.product.map(item => (
                    item.name
                ))}
            </Card>
        );
    }
}

export default Product;
